import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import Empreendedora from './pages/Empreendedora';
import './App.css';

function App() {
  return (

        <Routes>
        <Route exact path="/" component={ Home } />
        <Route path="/empreendedora" component={ Empreendedora } />
        </Routes>
  );
}

export default App;
